window.bookSummaryJSON = "<p><b>The only thing sadder than a battle won was the paperwork afterward</b><br> <br> Matt Fang has won the battle. He's got a new town, a whole new race of units to control and a lot of catching up to do. He's still stuck in this strange realm, one of the last defenders of humanity against an enemy he doesn't understand. Only contest.<br> <br> Still, he's got a job to do, even if it's not one he trained for.<br> <br> At least ruling a magical kingdom is better than punching in at the office.<br> <br> <i>Magic Kingdom at War</i> is a tactical, base-building, crunchy LitRPG novella series by Tao Wong, bestselling author of the <i>System Apocalypse, A Thousand Li, Climbing the Ranks, the Hidden Universe </i>and <i>Adventures on Brad</i> series.</p>"; 
